import React, { useEffect, useState } from 'react'
import { addDays, startOfDay, format } from 'date-fns'
import { Stashpoint } from './Data'

type cart = {
  readonly stashpointId: number
  readonly
}

const Home = () => {
  const [stachList, setStachList] = useState<Stashpoint[]>()
  useEffect(() => {
    fetch('http://localhost:3000/api/stashpoints')
      .then((res) => res.json())
      .then((response: Stashpoint[]) => {
        console.log(response)
        setStachList(response)
      })
      .catch((err) => console.log(err))
  }, [])

  let newDate = format(new Date(), 'yyyy-MM-dd')
  console.log(newDate)
  return (
    <div>
      <h1>Home</h1>
      <br />
      <div>
        <select>
          <option></option>
          {stachList?.map((data) => {
            return (
              <option key={data.id} value={data.id}>
                {data.name}
              </option>
            )
          })}
        </select>
        <input type='date' className='fromDate' min={newDate} />
        <input type='date' className='toDate' />
        <input type='number' />
        <button>Submit</button>
      </div>
    </div>
  )
}

export default Home
